import React from 'react';

const course = props =>{
  return (<div><p>Half Stack application development</p></div>)}



const App=()=>
{

  const part1 = 'Fundamental of React';
  const exercises1 = 10;
  const part2 = 'Using props to pass data';
  const exercises2 = 7;
  const part3 = 'State of a component';
  const exercises3 = 14;

  const app1=()=>
  {
    <div>
    <h1><course/></h1>
    <p>
      {part1} {exercises1}
    </p>
    <p>
      {part2} {exercises2}
    </p>
    <p>
      {part3} {exercises3}
    </p>
    <p>Number of exercises {exercises1 + exercises2 + exercises3}</p>
  </div>
  }

  return app1;

  }



export default App;
